// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './pages/Home';
import Login from './pages/Login'; // We'll create this later
import Register from './pages/Register'; // We'll create this later
import ShopOwnerDashboard from './pages/ShopOwnerDashboard';
import DriverDashboard from './pages/DriverDashboard';



const App = () => {
  return (
    <Router>
      <Routes>
        {/* Home Page */}
        <Route path="/" element={<Home />} />

        {/* Login Page (We'll create this later) */}
        <Route path="/login" element={<Login />} />

        {/* Registration Page (We'll create this later) */}
        <Route path="/register" element={<Register />} />

        <Route path="/customer-dashboard" element={<ShopOwnerDashboard />} />

        <Route path="/driver-dashboard" element={<DriverDashboard />} />


        {/* Add more routes here as we create more pages */}
      </Routes>
    </Router>
  );
};

export default App;
